import React from 'react';

const SeamlessConnectivity = () => {
    return(
        <div className='container mx-auto min-h-screen seamSec z-50 bg-white'  id='exp'>
            <div className='text-center py-[150px]'>
                <h2 className='text-6xl font-bold'>Seamless Connectivity</h2>
                <p>A strategic location where everything is within your reach. </p>
            </div>
        </div>
    )
}
export default SeamlessConnectivity;
